- input: "TEXT\x1CC00226522\x1C.TEXT\x1C\x1CF3A\x1CThis amendment corrects Election
    information on several disbursements, all of which were issued with no election
    designation.  All of our changes agree with what was submitted by the committee
    which had received our contribution, except for two, and letters have been sent
    to those committees asking them to correct their reports as well.  Additionally,
    this report is updated with information regarding 2 disbursements that had been
    voided and this information had inadvertantly been omitted from the report.  After
    review the request for further information, it became clear that a $1000 disbursement
    to the Heath Shuler for Congress Committee was in fact issued after that state's
    primary, and a formal request for a refund of this amount has been issued.  This
    should be reflected in the next report submitted by this committee.  Lastly, two
    Receipts were designated incorrectly and were corrected.\n"
